  };
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="App">
              <div id="container">
                <Header />
                <Body />
              </div>
            </div>
          }
        ></Route>
        <Route
          path="/:boardName"
          element={
            <div className="App">
              <div id="container-2">
                <Header2 />
                <div id="header2-content-body-container">
                  <MenuOverlay/>
                  <ProfileOverlay/>
                  <BoardHeader2 />
                  <Body2 />
                </div>
              </div>
            </div>
          }
        ></Route>
      </Routes>
    </Router>
  );
}

export default App;
